import React from "react";

import {
	Container,
	Cabecalho,
	Titulo,
	BotaoCriar,
} from "./PerfilUsuarioElementos";

const PerfilUsuario = () => {
	return (
		<Container>
			<Cabecalho>
				<Titulo></Titulo>
				<BotaoCriar>Criar</BotaoCriar>
			</Cabecalho>
		</Container>
	);
};

export default PerfilUsuario;
